(163, '_email_confirmation', 'Thank you very much for your reservation in our %s.\r\nWith pleasure we confirm your reservation for %s person(s) on %s at %s.\r\n\r\nIf you want cancel your reservation please use your booking number \'%s\' at the homepage.\r\n\r\nWe wish you an enjoyable stay at our restaurant and are looking forward to your visit!\r\n\r\nYours\r\n %s', 'Vielen Dank für Ihre Reservierung in unserem %s.\r\nGerne haben wir für Sie %s Person(en) am %s um %s reserviert.\r\n\r\nWenn Sie Ihre Reservierung stornieren möchten, können Sie dies mit der Buchungsnummer \'%s\' auf der Homepage vornehmen.\r\n\r\nWir wünschen Ihnen einen angenehmen Aufenthalt in unserem Restaurant und freuen uns auf Ihren Besuch!\r\n\r\nBeste Grüße\r\n%s', '', 'Muchas gracias por realizar su reserva en nuestro %s.\r\nNos complace confirmar su reservación para %s persona(s) el %s a las %s.\r\n\r\nSi quisiera cancelar su reservación, por favor use su número de registro \'%s\' en la página de inicio.\r\n\r\nLe deseamos un disfrutable paso por nuestro restaurant y estaremos pendientes a su visita.\r\n\r\nAtentamente,\r\n %s', 'Hartelijk dank voor uw reservering in ons %s.\r\nGraag bevestigen wij uw reservering voor %s personen op %s om %s\r\n\r\nIndien u uw boeking wilt annuleren, gebruik dan a.u.b.uw reserveringsnummer \'%s\'\r\n\r\nWij wensen u een prettige avond toe in ons restaurant en bedanken u voor uw bezoek.\r\n\r\nMet vriendelijke groeten,\r\n %s', '', 'Tack för er reservation för %s.\r\nVi bekräftar er reservation för %s person/er den %s hos %s.\r\n\r\nVid ändring eller avbokning hänvisa till bokningsnummer: \'%s\'.', 'La ringraziamo per la prenotazione nel nostro %s.\r\nConfermiamo di aver ricevuto una prenotazione per %s persona(e) il %s alle ore %s.\r\n\r\nSe volete annullare la vostra prenotazione vi preghiamo di usare la referenzar \'%s\' usando la pagina precedente.\r\n\r\nCordiali saluti\r\n %s', '', '', '', '', ''),
